import { motion } from "framer-motion";
import { useEffect } from "react";

function BackCircle() {
  const svgVariants = {
    hidden: { scale: 0, opacity: 0, rotate: 180 },
    visible: {
      scale: 1,
      opacity: 1,
      rotate: 0,
      transition: {
        duration: 5,
        delay: 0.3,
        ease: [0.42, 0, 0.58, 1],
        type: "spring",
        stiffness: 100,
        damping: 10,
      },
    },
  };

  useEffect(() => {
    setTimeout(() => {
      const svg = document.getElementById("backend-circle-svg");
      svg.classList.add("animate-spin-infinite");
    }, 1300);
  }, []);

  return (
    <motion.svg
      className="absolute left-0 right-0 top-0 bottom-0 m-auto"
      id="backend-circle-svg"
      width="514"
      height="529"
      viewBox="0 0 514 529"
      fill="none"
      xmlns="http://www.w3.org/2000/svg"
      xmlnsXlink="http://www.w3.org/1999/xlink"
      initial="hidden"
      animate="visible"
      variants={svgVariants}
    >
      <rect width="514" height="529" fill="url(#pattern0_13_44)" />
      <defs>
        <pattern
          id="pattern0_13_44"
          patternContentUnits="objectBoundingBox"
          width="1"
          height="1"
        >
          <use xlinkHref="#image0_13_44" transform="scale(0.000925926)" />
        </pattern>
        <image
          id="image0_13_44"
          width="1080"
          height="1079"
          xlinkHref="data:image/png;base64,"
        />
      </defs>
    </motion.svg>
  );
}

export default BackCircle;
